package com.yaowang.lansha.entity;import java.io.Serializable;import java.util.Date;/** * 礼物记录  * @author  *  */public class LanshaUserGiftStock implements Serializable{	private static final long serialVersionUID = 1L;		/**	 * id	 */	private String id;	/**	 * 用户id	 */	private String userId;	/**	 * 礼物id	 */	private String giftId;	/**	 * 库存	 */	private Integer stock;	/**	 * 创建时间	 */	private Date createTime;		/**	 * 设置id	 */	 public void setId(String id){	 	this.id = id;	 }	 	 /**	  * 获取id	  */	 public String getId(){	 	return this.id;	 }	/**	 * 设置用户id	 */	 public void setUserId(String userId){	 	this.userId = userId;	 }	 	 /**	  * 获取用户id	  */	 public String getUserId(){	 	return this.userId;	 }	/**	 * 设置礼物id	 */	 public void setGiftId(String giftId){	 	this.giftId = giftId;	 }	 	 /**	  * 获取礼物id	  */	 public String getGiftId(){	 	return this.giftId;	 }	/**	 * 设置库存	 */	 public void setStock(Integer stock){	 	this.stock = stock;	 }	 	 /**	  * 获取库存	  */	 public Integer getStock(){	 	return this.stock;	 }	/**	 * 设置创建时间	 */	 public void setCreateTime(Date createTime){	 	this.createTime = createTime;	 }	 	 /**	  * 获取创建时间	  */	 public Date getCreateTime(){	 	return this.createTime;	 }}